import React, { useEffect, useState } from 'react'
import axios from "axios"

 const Home = () => {
    let key="Wqi9oEy3bY7UVoFKW3TIZbxhlHa2LfN94h-CF17OHfI"
    let Url=`https://api.unsplash.com/photos/?client_id=${key}`

    const [resim,setResim]=useState([])

    useEffect(()=>{
        axios.get(Url)
        .then(response=>{
            setResim(response.data)
        })
    },[key])

    console.log(resim,"resim");

  return (
   <>
  <h3>Unsplash Resim </h3>


  {
    resim.map((resim,i)=>
    <li style={{listStyleType:"none"}} key={i}>
       <img src={resim.urls.small} />
    </li>
    )
  }

   </>
  )
}

export default Home;
